	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Это упражнение направлено на ту же группу мышц, что и жим штанги лежа. Но отличается от указанного упражнения тем, что жим гантелей лежа выполняется с большей амплитудой, что способствует большему растягиванию и сокращению грудных мышц, задействует большее число мышц-стабилизаторов.</p>\n<p>Если вы хотите правильно развивать грудные мышцы и увеличивать силовые показатели, то вы должны регулярно выполнять жимы гантелями.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Возьмите гантели в каждую руку, сядьте с ними на горизонтальную силовую скамью. Положите гантели на бедра и после этого лягте на скамью.</li>\n<li>Исходное положение: спина прогнута в пояснице, стопы ног упираются в пол. Руки с гантелями находятся на уровне плечей, грифы гантелей расположены на одной линии.</li>\n<li>На выдохе – вернитесь в исходное положение, максимально растягивая грудь.</li>\n<li>Проделайте необходимое количество повторений.</li>\n<li>Повторите упражнение нужное число раз.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Корпус наклоняйте вперед примерно на 20 градусов. Так положение тела более устойчиво.</li>\n  <li>Руки сводите перед собой и вниз. В нижней половине амплитуды сильнее работает низ груди. В верхней – верхняя часть груди.</li>\n  <li>Когда поднимаете руки, локти должны смотреть назад и немного вверх. В нижней точке можете полностью выпрямлять руки.</li>\n  <li>При выполнении упражнения следите, чтобы спина была прямая, грудь развёрнута, а лопатки сведены вместе. За счет этого грудные мышцы будут максимально растягиваться и сокращаться.</li>\n  <li>Упражнение изолирующее, рекомендуется в тренировке его делать для проработки после 1 – 2 базовых упражнений.</li>\n  <li>Изменяя наклон туловища, Вы можете переносить нагрузку на целевые мышцы: наклоняясь ниже, больше нагружается верх груди, меньше наклон, больше работает нижняя часть.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/zEC1gnrWZII\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/svedenie-v-krossovere","efficiency":"9","title":"Сведение рук в кроссове","image":"/static/0-03-0.jpg","image_2":"/static/0-03-1.jpg","image_3":"/static/0-03-2.jpg","image_4":"","filterby":"chest","date":"July 12, 2017","injury":"3","bodypart":"Грудь","filtertype":"isolated","type":"Изолирующее","filterinventory":"crossover","inventory":"Кроссовер","filterplace":""}}},"pathContext":{}}

