	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>На первый взгляд напоминает разводку на петлях TRX. Действительно движение похожее, однако смена угла позволяет сместить нагрузку на переднюю дельту. При прочих равных, грудь задействуется в минимальном процентном соотношении. Данное упражнение не вызовет затруднений у новичков, а опытным позволит акцентированней проработать переднюю дельту.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Отрегулируйте петли, чтоб оба конца были ровны</li>\n  <li>Возьмитесь за рукояти, пройдите вперед до полного натяжения лямок</li>\n  <li>Ладони обращены вперед, руки чуть согнуты в локтях</li>\n  <li>Отводим руки вверх - встороны. Равномерно распределяя вес тела на обе руки, опускаемся до комфортного растяжения дельтовидных и грудных мышц</li>\n  <li>Плавным движением возвращаем руки в исходное положение</li>\n  <li>Выполнить заданное количество повторений</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Если вы чувствуете грудные мышцы больше дельт, значит вам нужно разводить руки выше</li>\n  <li>Старайтесь акцентировать нагрузку на передней дельте, а грудные мышцы задействовать только в вспомогательном  режиме</li>\n  <li>Не делайте коротких движений, разводка должна быть широкой</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/z9Yyw0cYnPQ\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/razvodka-na-petlyah-pod-uglom","efficiency":"5","title":"Разводка на петлях под углом","image":"/static/1-05-0.png","image_2":"/static/1-05-1.png","image_3":"","image_4":"","filterby":"shoulders","date":"July 12, 2017","injury":"3","bodypart":"Плечи","filtertype":"base","type":"Базовое","filterinventory":"trx","inventory":"TRX Петли","filterplace":""}}},"pathContext":{}}

