	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Тяга за голову – упражнение для широчайших мышц спины. Требует большую подвижность плечевых суставов. Очень важно выполнять его правильно, если ваши суставы не позволяют дотянуть гриф до нужного уровня не согнув спину не делайте его – толку будет мало.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Возьмите гриф широких хватом сверху. Сядьте на лавку отрегулированного под Ваш рост тренажера. Бедра расположите под валиками.</li>\n<li>Исходное положение – спина прямо, руки выпрямлены, стопы плотно прижмите к полу.</li>\n<li>На выдохе – тяните гриф вниз, за голову примерно до середины затылка, сводя при этом лопатки вместе. Можете задержаться в крайнем положении.</li>\n<li>На вдохе – верните гриф в исходное положение.</li>\n<li>Выполните повторение тяги необходимое количество раз.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/3oGFh9Qodpg\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/tyaga-verhnego-bloka-za-golovu","efficiency":"6","title":"Тяга верхнего блока за голову","image":"/static/2-03-0.jpg","image_2":"","image_3":"","image_4":"","filterby":"back","date":"April 12, 2017","injury":"8","bodypart":"Спина","filtertype":"isolated","type":"Изолирующее","filterinventory":"blocktrenajer","inventory":"Блоки","filterplace":null}}},"pathContext":{}}

