	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Простое, и полезное упражнение! Прекрасно нагружает мышцы поясницы и ягодиц, а самое главное - при этом никакой нагрузки на позвоночник. Если у вас, грыжа или остеохондроз межпозвоночных дисков – гиперэкстензию на тренажере делать просто необходимо.</p>\n<ul>\n  <li>чем уже хват, тем сильнее работает бицепс, но увеличивается амплитуда, что позволяет сильнее растягивать мышцы спины</li>\n  <li>широкий хват напротив – переносит нагрузку на спину, но сокращает амплитуду упражнения</li>\n</ul>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Отрегулируйте скамью для гиперэкстензии так, чтобы верхняя часть бедер упиралась в тренажер, и можно свободно выполнить наклон вперед, сгибаясь в талии.</li>\n  <li>Лягте вниз лицом на скамью. Зафиксируйте голени под подставкой.</li>\n  <li>Исходное положение: туловище прямо, руки скрещены на груди или за головой.</li>\n  <li>На вдохе - медленно наклоняйтесь вперед, сгибаясь в талии. Спину держите прямо. Наклон продолжайте до тех пор, пока не почувствуете, что дальше наклоняться вперед без сгибания спины невозможен.</li>\n  <li>На выдохе - поднимите туловище в исходное положение.</li>\n  <li>Выполните необходимое количество повторений.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Техника выполнения гиперэкстензии – в первую очередь плавные движения, иначе вы можете травмировать спину.</li>\n  <li>Можете выполнять упражнение с отягощением (диск от штанги). Держите его перед грудью или за головой.</li>\n  <li>Гиперэкстензию легко делать и в домашних условиях. Для этого вполне подойдёт кровать или диван. Ещё понадобиться напарник, который будет держать Ваши ноги.</li>\n  <li>Это упражнение идеально для поясничных мышц спины. Вместе с тем, оно не оказывает нагрузки на позвончник. Поэтому гиперэкстензия поможет укрепить мышцы поясницы всем кто страдает от остеохондроза, грыжи дисков позвоночника и протрузии. Также помогает от болей в пояснице.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/qtjJUWCnDyE\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/giperextenzia","efficiency":"8","title":"Гиперэкстензия","image":"/static/2-07-0.png","image_2":"/static/2-07-1.png","image_3":"","image_4":"","filterby":"back","date":"April 12, 2017","injury":"2","bodypart":"Спина","filtertype":"isolated","type":"Изолирующее","filterinventory":"ownweight","inventory":"Собственный вес","filterplace":null}}},"pathContext":{}}

