	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Классическая становая тяга - отличное упражнение для стимуляции мышечного роста большой группы мышц. Одно из трех упражнений в пауэрлифтинге. Однако, сильно загружает мышцы поясницы, поэтому будьте осторожны и внимательно следите за плавностью движений, чтобы не получить травму.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Исходное положение - станьте вплотную к грифу штанги, ноги немного уже плеч. Присядьте и возьмите штангу хватом сверху. Плечи должны находиться ровно над грифом штанги. Спину держите ровно.</li>\n  <li>На выдохе – тяните штангу вверх, выпрямляя тело. Грифом штанги скользите вдоль ног. Полностью выпрямитесь, при этом сведите лопатки вместе.</li>\n  <li>На вдохе - начните движение в обратном направлении. При этом сначала отведите таз назад. Скользите грифом вдоль тела, сгибая спину. После того, как пройдете колени, начните сгибать ноги, держа при этом спину прямо. Коснитесь штангой пола.</li>\n  <li>Выполните необходимое число повторений.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Ступни обязательно ставьте под гриф штанги (примерно на 1/3 от длины стопы). Так Ваш центр тяжести во время выполнения упражнения будет расположен правильно и не даст Вам раскачиваться.</li>\n  <li>Вес штанги подбирайте такой, чтобы не выгибать спину во время становой тяги. Не можете держать спину прямо – обязательно облегчите нагрузку. Иначе Вы рискуете получить проблемы с позвоночником.</li>\n  <li>Если Вы испытываете боли в спине или поясницы, то если и будете выполнять становую тягу, то перед этим надо хорошенько размяться (сделать несколько подходов гиперэкстензии).</li>\n  <li>Используйте лямки чтобы снизить нагрузку на запястья. Не стоит выполнять становую тягу «разнохватом» (одна рука прямой хват, другая - обратный) при выполнении ваши мышцы не будут работать симметрично.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/a5zhnubunoE\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/stanovaia-tyaga","efficiency":"8","title":"Становая тяга","image":"/static/2-08-0.png","image_2":"/static/2-08-1.png","image_3":"","image_4":"","filterby":"back","date":"April 12, 2017","injury":"7","bodypart":"Спина","filtertype":"base","type":"Базовое","filterinventory":"stange","inventory":"Штанга","filterplace":null}}},"pathContext":{}}

