	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Для развития бицепса помимо упражнений со штангой и гантелями эффективно используются блочные тренажеры. Конечно не стоит заниматься только на тросовых тренажерах – работа со свободными весами должна быть основой любой тренировки, но сочетание с тросовым тренажером даст отличные результаты, обязательно разнообразие в упражнениях!</p>\n<p>Делая сгибания рук на нижнем блоке, вы придадите бицепсу четкую форму.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Исходное положение: возьмитесь за рукоятку, прикрепленную к тросу нижнего блока, нижним хватом. Встаньте прямо, слегка отклонитесь назад. Локти прижмите к корпусу. Ноги на ширине плеч.</li>\n<li>На выдохе – сгибайте предплечья до полного сокращения бицепса. Следите, чтобы локти не уходили вперед, а корпус не раскачивался.</li>\n<li>На вдохе – вернитесь в исходное положение.</li>\n<li>Выполните сгибание рук необходимое число раз.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/N0j54H6TZZM\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/sgibania-ruk-na-nijnem-bloke-v-crossovere","efficiency":"6","title":"Сгибания рук на нижем блоке в кроссовере","image":"/static/3-07-0.png","image_2":"","image_3":"","image_4":"","filterby":"biceps","date":"April 12, 2017","injury":"4","bodypart":"Бицепс","filtertype":"isolated","type":"Изолирующее","filterinventory":"crossover","inventory":"Кроссовер","filterplace":null}}},"pathContext":{}}

