	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Отжимания на брусьях – это непревзойденное упражнение для проработки трицепсов и грудных мышц, а также для укрепления плечевого пояса. Наряду с турником, брусья являются одним из самых доступных тренажеров. Они есть практически в каждом спортзале, на уличных спортплощадках, а у некоторых даже дома. В этой статье мы рассмотрим, как правильно отжиматься на брусьях и разберем особенности выполнения этого упражнения.</p>\n<p>Более продвинутые  могут добавить вес к упражнению, используя весовой пояс, который позволяет добавлять взвешенные пластины.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Исходное положение: встаньте между перекладинами, возьмитесь за них и поднимите свое тело, распрамив руки. Локти прижмите к корпусу и отведите назад.</li>\n<li>На выдохе – сгибайте руки до сокращения трицепса.</li>\n<li>На вдохе – вернитесь в исходное положение.</li>\n<li>Выполните отжимания на брусьях необходимое число раз.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/rCR4RuT-2KQ\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/otjimania-na-brusiah","efficiency":"8","title":"Отжимания на брусьях","image":"/static/4-00-0.jpg","image_2":"/static/4-00-1.jpg","image_3":"","image_4":"","filterby":"triceps","date":"April 12, 2017","injury":"3","bodypart":"Трицепс","filtertype":"base","type":"Базовое","filterinventory":"ownweight","inventory":"Собственный вес","filterplace":null}}},"pathContext":{}}

