	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Это одно из упражнений, направленных на проработку трицепса. Однако его лучше применять как дополнительное, после базовых упражнений для трицепса. Важно отметить то, что выполняя разгибания руки, делайте две паузы в верхней и нижней точке.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Возьмите в одну из рук гантель, обращая ладонь к вашему телу. Немного согните колени и сделайте наклон вперед, сгибаясь в области талии. Взгляд устремлен вперед, а спина практически параллельна уровню пола. Можете опереться другой рукой и коленом в горизонтальную силовую скамью.</li>\n<li>Исходное положение: Область руки от локтя до плеча располагается на одном уровне с линией тела. Согните руку в локте под прямым углом, чтобы  предплечье было перпендикулярно относительно пола.</li>\n<li>На выдохе – плечо находится неподвижным, в то время как, напрягая трицепс, Вы выполняете разгибание руки. В верхней точке зафиксируйте ненадолго руку.</li>\n<li>На вдохе – плавно верните руку в исходное положение, снова зафиксировав положение.</li>\n<li>После выполнения одной рукой, сделайте упражнение другой.</li>\n<li>Выполните необходимое количество повторений.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/HyqTb_jE_oI\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/razgibanie-ruki-v-naklone","efficiency":"7","title":"Разгибание руки в наклоне","image":"/static/4-02-0.jpg","image_2":"/static/4-02-1.jpg","image_3":"","image_4":"","filterby":"triceps","date":"April 12, 2017","injury":"5","bodypart":"Трицепс","filtertype":"isolated","type":"Изолирующее","filterinventory":"dumbbells","inventory":"Гантели","filterplace":null}}},"pathContext":{}}

