	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Скручивание – базовое упражнений для формирования пресса, направлено в основном на прямую мышцу брюшной области. При выполнении упражнения главное - скрутиться, а не высоко подниматься. Так же можно поворачивать туловище, касаясь локтем колена.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Исходное положение: лежа на спине, упритесь ступнями в пол, колени согнуты под углом в 90 градусов. Руки заведены за голову, локти вовнутрь.</li>\n  <li>На выдохе - начинайте скручивание. Упираясь поясницей в пол поднимайте плечи. Отрывайте их не больше чем на 10 см, поясница при этом остается прижатой к полу. В конечной точке задержитесь и напрягите пресс.</li>\n  <li>На вдохе - медленно вернитесь в первоначальное положение.</li>\n  <li>Выполните необходимое количество повторений.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Можно делать как с согнутыми ногами, так и с прямыми. С согнутыми - чуть сложнее, потому что при сгибании ног уже немного сокращается пресс. Удобнее будет засунуть ноги под какую-нибудь опору или попросить чтобы их кто-то держал.</li>\n  <li>При выполнении можно использовать утяжеление (диск от штанги).</li>\n   <li>Старайтесь скрутиться по максимуму. Представьте, что хотите коснуться лбом коленей. Но при этом не отрывайте поясницу от пола, чтобы не включать в работу поясничную мышцу.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/F86KLvmRCp4\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/skrucivania-leja","efficiency":"10","title":"Скручивания лежа","image":"/static/5-00-0.png","image_2":"/static/5-00-1.png","image_3":"","image_4":"","filterby":"abs","date":"April 12, 2017","injury":"1","bodypart":"Пресс","filtertype":"isolated","type":"Изолирующее","filterinventory":"ownweight","inventory":"Собственный вес","filterplace":null}}},"pathContext":{}}

