	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Планка интересное и набирающее популярность упражнение – его цель создать крепкий мышечный корсет тела – живот, поясницу. Упражнение базовое общеукрепляющим для многих других групп мышц тела. Планка относится к классу статических упражнений, т.е. не требует движения суставов.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Лягте на пол (при наличии используйте гимнастический коврик)</li>\n  <li>Исходное положение - вытяните тело, опираясь на две опорные точки –предплечья (держите их под точным углом в 90 градусов и параллельно друг другу на ширине плеч) и носки стоп. Ноги вместе, взгляд направлен в пол. Плечи отведены назад и вниз.</li>\n  <li>Держите тело прямым – так, чтобы голова, позвоночник и ноги были строго на одной линии. Напрягите мышцы брюшного пресса и ягодиц и контролируйте неподвижность тела.</li>\n  <li>Продержитесь в таком положении максимально долго.</li>\n  <li>Выполните необходимое число повторений.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Существует большое число вариаций выполнения упражнения. Самые популярные- с выносом руки вперед, боковая с поворотом, с поднятием одной ноги, на прямых руках. Увеличивайте время выполнения упражнения планка и усложняйте его!</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/tgbrMdfuGJA\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/planka","efficiency":"6","title":"Планка","image":"/static/5-02-0.png","image_2":"/static/5-02-1.png","image_3":"","image_4":"","filterby":"abs","date":"April 12, 2017","injury":"1","bodypart":"Пресс","filtertype":"isolated","type":"Изолирующее","filterinventory":"ownweight","inventory":"Собственный вес","filterplace":null}}},"pathContext":{}}

