	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Подъем ног в висе на перекладине является одним из самых лучших упражнений для проработки мышц пресса. Подъем можно осуществлять как с согнутыми ногами, так и с прямыми.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Исходное положение: возьмитесь узким хватом и повисните на перекладине.</li>\n  <li>На выдохе – сделайте подъем ног вверх, пока не коснетесь коленями груди.</li>\n  <li>На вдохе –  медленно опустите ноги в исходное положение.</li>\n  <li>Сделайте подъем ног требуемое число повторов.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>При неправильном исполнении упражнения амплитуда уменьшается, а ноги находятся на уровне горизонтали. В таком исполнении работает только часть живота и эффективность уменьшается.</li>\n  <li>Выполняя упражнение, не помогайте себе руками и не раскачивайтесь.</li>\n  <li>Ноги можно не опускать до нижней точки. Это позволит сильнее нагрузить мышцы пресса.</li>\n  <li>Подъем ног можно делать не только прямо к груди, но и разные стороны. Так Вы сможете включить косые мышцы живота.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/Nw0LOKe3_l8\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/podjem-nog-v-vise","efficiency":"7","title":"Подъем ног в упоре","image":"/static/5-04-0.png","image_2":"/static/5-04-1.png","image_3":"","image_4":"","filterby":"abs","date":"April 12, 2017","injury":"2","bodypart":"Пресс","filtertype":"isolated","type":"Изолирующее","filterinventory":"ownweight","inventory":"Собственный вес","filterplace":null}}},"pathContext":{}}

