	module.exports = {"data":{"markdownRemark":{"html":"<h3>Описание:</h3>\n<p>Наклоны с гантелей в сторону стоя является изолирующим упражнением, основная цель которого, проработать косые мышцы живота. Оно подойдет как для новичков, так и для профессиональных спортсменов.\nАбсолютно ненужное упражнение.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Исходное положение: поставьте ноги на ширине плеч и возьмите гантель правой рукой так, чтобы ладонь была направлена к туловищу. Левую руку поставьте на талию.</li>\n  <li>На вдохе – держа спину ровно, сделайте наклон, сгибаясь в талии влево, максимально низко. В нижней точке задержитесь на секунду.</li>\n  <li>На выдохе – плавно вернитесь в исходное положение.</li>\n  <li>Выполните необходимое количество повторений каждой из рук.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Выполняйте упражнение строго в бок, не выдвигая тело вперед, так как эффективность упражнения сильно уменьшится.</li>\n  <li>Старайтесь зафиксировать таз на месте, и делать наклоны исключительно сгибаясь в талии.</li>\n  <li>Не устанавливайте слишком большие веса на гантели, поскольку есть вероятность увеличить талию.</li>\n  <li>Не стоит использовать одновременно две гантели. Так Вы создадите противовес друг для друга  и снизите эффективность упражнения до нуля.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width=\"100%\" height=\"550rem\" src=\"https://www.youtube.com/embed/0vHZHPBCZy8\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>","frontmatter":{"path":"/exercise/naklony-s-gantelei-v-storonu-stoia","efficiency":"4","title":"Наклоны с гантелей в сторону стоя","image":"/static/5-06-0.png","image_2":"/static/5-06-1.png","image_3":"","image_4":"","filterby":"abs","date":"April 12, 2017","injury":"1","bodypart":"Пресс","filtertype":"isolated","type":"Изолирующее","filterinventory":"dumbbells","inventory":"Гантели","filterplace":null}}},"pathContext":{}}

